const StoreLoginData = (data, headers) => {

    let newData = localStorage.setItem('data',JSON.stringify(data))
    let newHeaders  = localStorage.setItem('headers',JSON.stringify(headers))
    console.warn('loginData=',localStorage.getItem(JSON.parse('data')))
}

export default StoreLoginData;
